import React from "react";

function RegisterPage() {
  return (
    <>
      <div className="mt-8 w-full max-w-sm mx-2 rounded-md overflow-hidden p-4">
        <div className="bg-white">
          <h2>Welcome To Chat app!</h2>
        </div>
      </div>
    </>
  );
}

export default RegisterPage;
